INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Romance', 123, 143418769, ' Ravinder Singh  ', 'I Too Had A Love Story (Paperback) ', 'I Too Had A Love Story narrates the personal story of the author, Ravinder Singh. The book begins in March 2006, when the author and his close friends from college meet after a long time, their work having taken them to different places. None of them are married, and on an impulse, they all register themselves at a matrimonial site, upload their profiles, specifying their preferences.', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Biography', 137, 8129124912, 'APJ Abdul Kalam', 'My Journey: Transforming Dreams Into Actions (Paperback)', 'From a small boy growing up in Rameswaram, to becoming the countrys eleventh President, A.P.J. Abdul Kalams life has been a tale of extraordinary determination, courage, perseverance and the desire to excel. In this series of anecdotes and profiles, Dr Kalam looks back on key moments in his pastsome small and some momentousand tells the reader how each of them inspired him profoundly. With warmth and affection, he talks about the people who left a deep impression on him as he was growing up and as an adult, and the lessons he drew from his interactions with them.\r\n\r\nHe describes those who have been the closest to himhis father with his deep love of God, his mother and her great kindness, his mentors who helped shape his thoughts and outlook. There are heart-warming accounts here of his childhood years spent in a small town by the Bay of Bengal and the many struggles and sacrifices made on the path to becoming a scientist and then the President of India. Dr Kalam also writes about the t', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Romance', 105, 8129135728, 'Chetan Bhagat', 'Half Girlfriend (English)(Paperback)', 'Once upon a time, there was a Bihari boy called Madhav. He fell in love with girl called Riya. Madhav didn''t speak English well. Riya did. Madhav wanted a relationship. Riya didn''t. Riya just wanted friendship. Madhav didn''t. Riya suggested a compromise. She agreed to be his half-girlfriend. From the author of the blockbuster novels Five Point Someone, One Night @ the Call Center, The 3 Mistakes of My Life, 2 States and Revolution 2020 comes a simple and beautiful love story that will touch your heart and inspire you to chase your dreams.', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Educational & Professional', 94, 8175960299, 'Murphy ', 'Essential English Grammar (Murphy) (Paperback)', 'Essential English Grammar is a grammar reference and practice book for elementary learners. Modeled on Raymond Murphy''s highly successful Intermediate English Grammar', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Fiction & Non-Fiction', 65, 9384030570, 'Ashwin Sanghi ', '13 Steps To Bloody Good Luck (Paperback) ', 'The journey of life isn''t exactly easy...Some people make it through hard work and talent.Some fall by the wayside. And some people are justplain lucky. They are blessed with Bloody GoodLuck!\r\n\r\nBut is it possible to attract good luck? Can we trainourselves to be lucky? Apparently it seems that DameLuck isn''t that fickle. She is well within our reach.\r\n\r\nIn his first non-fiction foray, bestselling authorAshwin Sanghi explores that critical, much-longedfor element called luck.\r\n\r\nThrough entertaining and informative anecdotes,narrations of personal experiences and vignettes ofhomespun wisdom, Ashwin gives us a whole newinsight into how people can work towards beinglucky.\r\n\r\nIt seems that luck isn''t entirely the twist of fate thatit is made out to be!\r\n\r\n"13 Steps to Bloody Good Luck is a book worthreading. I''ve always said that it''s better to be luckythan to be good."', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Romance', 196, 9780141345659, 'John Green', '\r\nThe Fault in Our Stars (English)\r\n(Paperback) ', ' The Fault In Our Stars is inspired by the author’s experiences while working with children suffering from life threatening diseases in a hospital. It is a witty, thrilling and heartbreaking story of a sixteen year old girl, Hazel, who is a cancer patient, and is forced by her parents to attend the Cancer Kid Support Group. Through her friend Isaac, she encounters Augustus Waters, an amputee and ex-basketball player. After the support group ends, Augustus suggests that they watch a movie at his house. There, they talk a lot and he gets to know of her favourite novel, An Imperial Affliction.\r\n\r\nAfter reading it, he too gets as obsessed with it as Hazel is. They begin to spend a lot of time together and soon fall in love. Augustus decides to use his wish from ‘The Genies’, a fictionalized version of the Make a Wish Foundation, to fly Hazel and himself to Amsterdam to meet the author of the book, Peter van Houten. What happens next is a funny yet touching tale of two young lovers, fightin', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Romance', 130, 9780143417231, 'Ravinder Singh', 'Can Love Happen Twice? (English)\r\n(Paperback)', ' Can Love Happen Twice? is the sequel to Singh’s previous book, I Too Had A Love Story. It starts off with Happy, Manpreet, Amardeep, and Ravin having to attend a radio talk show called Raat gayi, baat baki in Chandigarh, on Valentine’s Day. However, Ravin does not show up that evening. Later that evening, word spreads about Ravin’s girlfriend’s death in a road accident.\r\n\r\nThis event leaves Ravin completely shattered, and he spirals into depression. He then decides to opt for an onsite job in Belgium, in an attempt to divert his mind from this great loss. He wants a change as the same surroundings remind him of the dreadful event that took place in his life. Things take a turn for the better during his time at Belgium, where he meets Simar, who is pursuing her MBA over there. Her hostel is just a stone’s throw away from Ravin’s office. They begin to bump into each other on a regular basis, and Ravin begins to feel a sense of attraction toward her.\r\n\r\nAfter getting to know details about Ravin’s past relationship, she finds him extremely romantic and caring, while Ravin thinks everything about her is cute. After working there for 10 months, he needs to go back to India, and the two decide to get married. Simar lands back in India, and Ravin goes to meet her parents in Gurgaon. However, Simar wants them to live in Belgium, away from his parents. Does the couple patch up or is it going to be yet another heartbreak for Ravin?', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Romance', 112, 9780143417699, 'Durjoy Datta', '\r\nPMR: Someone Like You (English)\r\n(Paperback)', ' Niharika Singh is the protagonist of Someone Like You. She is a normal girl with whom many young women can identify with. Shy, having low self esteem, and lacking confidence, Niharika feels nonexistent and ugly, until the day her sister Simran gives her a makeover. This transforms Niharika, and helps her realize that she is a beautiful, young woman after all. She soon decides to attend college in a new city.\r\n\r\nNiharika’s adventure truly begins when she befriends three boys, Karthik, Akshat, and Tanmay. Of the three, Tanmay becomes her best friend, Akshat remains out of bounds, because he is her sister’s ex-boyfriend, and Karthik remains a mystery, for whom Niharika has conflicted feelings. But later, Niharika discovers that his aggressiveness is simply a blanket to hide his past. She also goes on to make friends with Pia, who is also her roommate.\r\n\r\nThings start to spice up when Tanmay develops an interest for Pia. Pia begins reciprocating the same, but she is also involved in a long distance relationship with another boy named Vishal. Niharika and Akshat also begin to question their feelings for each other, adding more spice to the saga.\r\n\r\nAlthough readers are expecting unresolved love stories, the novel takes unexpected twists and turns, much to the readers’ surprise.\r\nSomeone Like You was published in 2013 by Penguin. It debuted at the number 5 spot in Hindustan Times.', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Fiction & Non-Fiction', 186, 9780143423959, 'Karan Bajaj', ' The Seeker (English) (Paperback) ', 'Can a man walk on water?\r\nCan he see the future?\r\nCan he read peoples minds?\r\nOne man will find answers that challenge all his rational beliefs. After a deep personal loss, Maximus Pzoras, Harvard economist and Wall Street banker, sets out on a quest to find the cause of human pain and suffering. His journey takes him from New York to a hidden ashram in south India to a drought-stricken village to a freezing cave high in the Himalayas. And as he goes from cubicle dweller to cave dwelling yogi, he starts to develop extraordinary powers. But will Max, investment banker turned Himalayan sage, find the answers to the questions that led him to India? The Seeker is both a gripping adventure and a story of a mans tremendous inner transformation, a Siddhartha for our generation.', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Educational & Professional', 458, 9780195689624, 'DR S. KUMAR, DR R. N. SAHAI ', 'Oxford English-English-Hindi Dictionary (English) 1st Edition', ' Oxford English-English-Hindi Dictionary is the first dictionary of its kind published by the Oxford University Press, carrying its rich tradition of publishing world-class dictionaries. The publications of the press are popular all over the world and are translated into several languages. The dictionary is useful for teachers, general readers and translators.\r\n\r\nThe dictionary includes more than 50,000 entries, and idioms and phrases. It not only covers general words in English, but also technical and scientific words. Its special feature is that it is region-oriented and contains words that are especially prevalent in the Indian subcontinent. A deep understanding of everyday idioms is quite useful for daily conversation in the English language. The revised edition has several new words over and above the previous editions.\r\n\r\nThe dictionary also contains accurate pronunciations of the words contained therein, both in English as well as in Hindi. It also contains synonyms and detailed', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Educational & Professional', 358, 9781259004612, 'E. Balaguruswamy', '\r\nProgramming in ANSI C (English) 6th Edition\r\n(Paperback)', 'For those who has just stepped into the world of C language, Programming in ANSI C: Virtual Lab for C Programming 6th Edition is the best book to initiate the learning process. Programming in ANSI C: Virtual Lab for C Programming teaches the programming language in a simple and logical language. There are a number of tests which one can evaluate automatically and receive feedback. This book ensures that students learn to grapple with the concepts of “looping”, “ functions”, “classes”, “operators,” “data types”, “branching” etc.\r\n\r\nProgramming codes with detailed comments have been emphasized throughout the book. Students will find both the Case Studies and “Just Remember” section very handy. The author has introduced review questions and new programs section.', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Biography', 675, 9781473605206, 'Sachin Tendulkar Majumdar Boria', 'Playing It My Way: My Autobiography (English) (Hardcover)', 'When he was a young boy, Sachin Tendulkar''s brother  introduced him to a game which was to change his life and the lives of millions of Indian. The young boy was a natural cricketer, but practiced for hours on end, standing strong when others would have fallen. His coach egged him on, challenging him to up his game. And he did, becoming more than just a star in the cricketing firmament. He went on to become the youngest Indian player in international cricket, winning the hearts of millions of fans as he blazed his way to century after century, rewriting record after record.', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Fiction & Non-Fiction', 356, 9788184771695, 'Suzanne Collins', '\r\nThe Hunger Games (English)\r\n(Paperback) ', ' The Hunger Games is narrated by the protagonist of the story, Katniss Everdeen. The story unfolds in the district of Panem, during the post-apocalyptic period. The district has a time-honoured tradition called the Hunger games. Two participants (a girl and a boy) are chosen via a lottery system from each district, to fight until death, in an area filled with forests, lakes, and mountain ranges.\r\n\r\nWhen her sister Primrose is chosen to participate in the game, Katniss adamantly volunteers to go in her place. The male competitor from District 12 is Peeta, the baker’s son. Both participants are taken to an area called the Capitol. The Capitol is a harsh and cruel place. They keep all the districts on edge by forcing them to send a girl and boy, between the ages of 12 to 18, to fight in the Hunger games. Once the contestants reach the Capitol, their coach Haymitch Abernathy, his assistant Effie, and their designer Cinna, work together to create a strategy for both players to enact in the ', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Fiction & Non-Fiction', 350, 9788184776218, 'Suzanne Collins', '\r\nMockingjay (English)\r\n(Paperback) ', ' The culminating novel in The Hunger Games trilogy of novels authored by Suzanne Collins, Mockingjay follows the story of Katniss Everdeen, who has twice survived the brutal and violent Hunger Games.\r\n\r\nIn this novel, she reluctantly accepts a proposal from District 13, the group behind the rebellion in Panem, by agreeing to be ‘Mockingjay’, the symbol representing the rebellion spearheaded by them, and their president Alma Coin. In exchange, she is assured immunity for all the past Hunger Games’ tributes including her closest friends, Finnick Odair, and Peeta Mellark, as well as the sole privilege of killing President Snow upon his capture.\r\n\r\nTo fulfill her end of the bargain, she must participate in a series of films entitled Propos, as propaganda for the rebellion. Meanwhile, the Capitol’s secret plan of bombing District 13 comes to light, and the rebels launch their own military strategy against the Capitol, in retaliation. For this purpose, Katniss is sent on a coverup Propos ass', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Biography', 420, 9788184983180, 'Jane Hawking', '\r\nTravelling to Infinity: My Life with Stephen (English)\r\n(Paperback)', 'Professor Stephen Hawking is one of the most famous and remarkable scientists of our age, and author of the scientific bestseller A Brief History of Time, which sold over 25 million copies across the world. In this compelling memoir, his first wife Jane relates the inside story of their extraordinary marriage. As Stephen s academic renown soared, his body was collapsing under the assaults of motorneuron disease, and Jane s candid account of trying to balance his twentyfourhour care with the needs of their growing family will be inspirational to anyone dealing with family illness. The inner strength of the author, and the selfevident character and achievements of her husband, make for an incredible tale that is always presented with unflinching honesty; the author s candour is no less evident when the marriage finally ends in a highprofile meltdown, with Stephen leaving Jane for one of his nurses, while Jane goes on to marry an old family friend.\r\n\r\nIn this exceptionally open, moving and often funny memoir, Jane Hawking confronts not only the acutely complicated and painful dilemmas of her first marriage, but also the faultlines exposed in a relationship by the pervasive effects of fame and wealth. The result is a book about optimism, love and change that will resonate with readers everywhere.', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Educational & Professional', 550, 9789351416401, 'Sarvesh K. Verma', 'Quantitative Aptitude Quantum CAT', 'Quantitative Aptitude Quantum CAT Common Admission Test for Admission into IIMs 7th Edition is a comprehensive book for undergraduates aspiring for admission into a postgraduate program in management in India through the Common Admission Test. The book is designed with the latest examination pattern in view and is particularly helpful for students aspiring to join one of the Indian Institutes of Management. The book contains over 3000 conceptual explanations, 8000 solved examples and 4000 practice problems for the students to completely understand the examination pattern. In addition, there are solved papers from other similar competitive exams such as XAT, IIFT and SNAP.', );
INSERT INTO `books` (`category`, `price`, `isbn`, `author`, `title`, `description`, `image`) VALUES
('Biography', 496, 9789381398869, 'Dilip Kumar', '\r\nDilip Kumar - The Substance and the Shadow : An Autobiography (English)\r\n(Hardcover)', 'Dilip Kumar was born as Yousuf Khan. He started as a shy rookie in Hindi cinema in the early 1940s and there was no looking back. He went on to reach the zenith of stardom within a short period of time. He delivered mesmerizing performances in one hit movie after another, in a row! His almost six-decade-long career as an actor was based only on his original ability, unwavering willpower, sheer hard work and die-hard optimistic attitude. In this book, Dilip Kumar tells us his journey right from his birth, his days as an aspiring actor, his ascent to the pinnacle of success and the rest, to the present day. He frankly narrates his relationships with different variety of people. His interactions were not only restricted to his family, friends and the film world but also with businessmen and politicians. Dilip Kumar sets the record straight about how he got married to Saira Banu, one of the then Bollywood beauties. He feels that a lot of what was written about him so far is mostly misinterpreted, and so he narrates, in graphic detail, about his romantic relationship and marriage, which pretty much reads like a fairy tale! He fondly remembers the event that changed his life forever - his meeting with Devika Rani, the boss of the famous Bombay Talkies, and being offered an acting job. His first film was Jwar Bhata (1944). He explains how he had to learn the whole kit and caboodle from scratch and how he had to cultivate his own individual dramatics and panache that would set him ap', );

